import React,{Component} from 'react';

import './popup.css';

class Popup extends Component {

    render(){
        return(
            <div id='containerPopup'>
                <div id='internPopup'>
                    <h1>{this.props.txt}</h1>
                    <button onClick={this.props.delete} name='sim'>Sim</button>
                    <button onClick={this.props.close} name='não'>Não</button>
                </div>
            </div>
        )
    }

}

export default Popup
